<div class="floatright"><a href="/wiki/File:Lingua_Libre_logo_square_2020.png" title="File:Lingua Libre logo square 2020.png"><img alt="Logo Lingua Libre" src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Lingualibre-logo.svg/200px-Lingualibre-logo.svg.png" width="200" height="149" srcset="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Lingualibre-logo.svg/300px-Lingualibre-logo.svg.png 1.5x, https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Lingualibre-logo.svg/400px-Lingualibre-logo.svg.png 2x" /></a></div>
<p><b>Lingua Libre</b> to projekt, który stawia sobie za cel wspólną budowę wielojęzycznego, audiowizualnego korpusu nagrań na wolnej licencji dla poszerzenia wiedzy językoznawczej i rozwoju projektów internetowych poświęconych językom.<br /><b>Ty</b> możesz nam pomóc!<br />
<small>Odwiedź <a href="/wiki/Special:MyLanguage/LinguaLibre:About" title="Special:MyLanguage/LinguaLibre:About">tę stronę</a> jeśli chcesz dowiedzieć się więcej o tym projekcie.</small>
</p>
<div style="clear:both;"></div>
<div style="display: flex; flex-direction: row; flex-wrap: wrap;">
<div style="display: flex; flex-direction: column; flex: 1 1 25em;">
<div style="box-shadow: 0 0 0.2em #999999; border-radius: 0.2em; margin: 0.5em 0.5em 1em 0.5em; background: #f8f9fa; flex: 1 1 auto">
<div style="background: #884DA7; border-radius: 0.2em 0.2em 0 0; padding: 0.5em 1em 0.5em 1em;"><span style="color: white; font-weight: bold;">Zanim rozpoczniesz</span>
</div>
<div style="padding: 0.5em 1em 0.5em 1em; border-radius: 0 0 0.2em 0.2em;"><div style="clear:both;"></div>
<p><small>Możesz utworzyć <a href="#1">swoją stronę użytkownika</a> klikając na link. Rekomendujemy włożenie na nią szablonu "babel". To użyteczny sposób wskazania innym, jakimi językami mówisz, i umożliwienie odnalezienia osób mówiących danym językiem. Jeśli nie znasz <a href="https://en.wikipedia.org/wiki/Help:Wikitext" class="extiw" title="w:Help:Wikitext">wikikodu</a>, możesz przejść do <a href="/wiki/User:Example" title="User:Example">tej demonstracyjnej strony użytkownika</a>, przeczytać instrukcję i skopiować szablon babel na <a href="/wiki/Special:MyPage" title="Special:MyPage">swoją stronę użytkownika</a> a następnie dostosować informacje do siebie i opublikować stronę.</small>
</p>
<div style="clear:both;"></div>
</div>
</div>
</div>
<div style="display: flex; flex-direction: column; flex: 1 1 25em;">
<div style="box-shadow: 0 0 0.2em #999999; border-radius: 0.2em; margin: 0.5em 0.5em 1em 0.5em; background: #f8f9fa; flex: 1 1 auto">
<div style="background: #36C; border-radius: 0.2em 0.2em 0 0; padding: 0.5em 1em 0.5em 1em;"><span style="color: #FFF; font-weight: bold;">Jak zacząć?</span>
</div>
<div style="padding: 0.5em 1em 0.5em 1em; border-radius: 0 0 0.2em 0.2em;"><div style="clear:both;"></div>
<ul><li><small>Przejdź kroki <a href="/wiki/Special:RecordWizard" title="Special:RecordWizard">Asystenta nagrań</a></small></li>
<li><small>Pomyśl jakie słowa chciałbyś nagrać. Możesz wprowadzić je oddzielone znakiem #, użyć istniejącej kategorii z Wikisłownika lub Wikipedii, użyć utworzonej przez innych listy, albo <a href="/wiki/Special:MyLanguage/Help:Create_your_own_lists" title="Special:MyLanguage/Help:Create your own lists">stworzyć własną</a>.</small></li></ul>
<div style="clear:both;"></div>
</div>
</div>
</div>
</div>
<div style="display: flex; flex-direction: row; flex-wrap: wrap;">
<div style="display: flex; flex-direction: column; flex: 1 1 25em;">
<div style="box-shadow: 0 0 0.2em #999999; border-radius: 0.2em; margin: 0.5em 0.5em 1em 0.5em; background: #f8f9fa; flex: 1 1 auto">
<div style="background: #339966; border-radius: 0.2em 0.2em 0 0; padding: 0.5em 1em 0.5em 1em;"><span style="color: white; font-weight: bold;">Czy potrzebujesz pomocy?</span>
</div>
<div style="padding: 0.5em 1em 0.5em 1em; border-radius: 0 0 0.2em 0.2em;"><div style="clear:both;"></div>
<p><small>Odwiedź <a href="/wiki/Special:MyLanguage/Help:Main" title="Special:MyLanguage/Help:Main">tę stronę pomocy</a>, gdzie znajdziesz porady dla początkujących użytkowników Lingua Libre. Jeśli nie znalazłeś odpowiedzi na swoje pytanie, zadaj je <a href="/wiki/LinguaLibre:Chat_room" title="LinguaLibre:Chat room">tutaj</a>.</small>
</p>
<div style="clear:both;"></div>
</div>
</div>
