<h2><span id="Need_more_?"></span><span class="mw-headline" id="Need_more_.3F">Need more&#160;?</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=User_talk:Olaf&amp;action=edit&amp;section=1" title="Edytuj sekcję: Need more ?">edytuj</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>Hello Olaf, your <a rel="nofollow" class="external text" href="https://commons.wikimedia.org/w/api.php?action=query&amp;list=users&amp;ususers=Olaf&amp;usprop=groups%7Ceditcount%7Cregistration">current userrights on Commons</a> limits you to <a href="/wiki/LinguaLibre:User_rights#User_rights_on_Commons" title="LinguaLibre:User rights">380 recordings per 72mins</a>. We can upgrade you rapidly via a request on <a href="https://commons.wikimedia.org/wiki/Commons:Requests_for_rights" class="extiw" title="commons:Commons:Requests for rights">Commons:Requests for rights</a>. Interested&#160;? <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 23:07, 17 February 2021 (UTC)
</p>
<dl><dd>Hoy, I see you are also a bot master. We actually <a rel="nofollow" class="external text" href="https://github.com/lingua-libre/Lingua-Libre-Bot/tree/master/wikis">have a bot</a> who injects LL's audio into Wikimedia's wikis, but not all wikis localizations (languages) are authorized. We look for help on this side. But if you have a bot, I think we could also be interested to check it a bit too. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 01:55, 18 February 2021 (UTC)
<dl><dd>You seem to enjoy your new sky&#160;! ^^ <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 21:43, 20 February 2021 (UTC)</dd></dl></dd></dl>
<h2><span class="mw-headline" id="Bot">Bot</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=User_talk:Olaf&amp;action=edit&amp;section=2" title="Edytuj sekcję: Bot">edytuj</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>Olafbot got the bot status from Pamputt. I moved our conversation to <a href="/wiki/LinguaLibre:Technical_board" title="LinguaLibre:Technical board">LinguaLibre:Technical board</a>, I didn't answer there to leave this opportunity to others (you may want to ping Poslovitch and VIGNERON on that one). But I think we get a good filter tool in line with your vision via either per-language commons category or/and sparql queries. The implemetation is to design, and they will see details better than me, but it's sounds possible to me. Anyway, let's see on the T-board how does the conversations goes&#160;! <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 12:24, 25 February 2021 (UTC)
</p>
<dl><dd>As for your question about other non-Lili audios, I think we should ignore them. Lili has the firepower and methodology to roll on them, replace them, and we should do so. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 13:34, 26 February 2021 (UTC)
<dl><dd>Olaf hello,</dd>
<dd>Is your bot simple or a large multitask beast&#160;? I would be interested to add its code to our github.com/lingua-libre'. I'am also personally interested to edit UNILEX's lists and talkpages programatically. So I'am looking for code samples, NodeJS first.... but Python seems accessible as well. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 11:44, 1 March 2021 (UTC)
<dl><dd>Ok, thank you. So I will explore <a href="/wiki/Help:Bots" title="Help:Bots">Help:Bots</a>'s Wiki API, a JS based project. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 17:02, 1 March 2021 (UTC)</dd>
<dd>Note: I also therefore assume that your bot should not be migrated on our LinguaLibre repository. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 17:27, 1 March 2021 (UTC)</dd></dl></dd></dl></dd></dl>
<h2><span class="mw-headline" id="OlafBot">OlafBot</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=User_talk:Olaf&amp;action=edit&amp;section=3" title="Edytuj sekcję: OlafBot">edytuj</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>Hello Olaf, I'am pausing few days before running my Dragons Bot to import UNILEX's lists. Doing so I wrote down <a href="/wiki/LinguaLibre:Chat_room#Pause_before_running" title="LinguaLibre:Chat room">the rational</a>, can you review it and edit to add the number of lists you created&#160;? I believe its 72. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 14:43, 3 March 2021 (UTC)
</p>
<dl><dd>Olaf, did you take a look to my <a href="/wiki/LinguaLibre:Chat_room#Marathi_women_speakers_celebrate_.27Women.27s_Day.27_.26_.27Women_History_Month.27_on_Lingua_Libre" title="LinguaLibre:Chat room">Marathi bash code</a> on the chatroom. While I think unilex lists should be constant, as a methodical 101 straight path, I think the Marathi "by letter" requests may gain from your bot. If I understand well your bot is the only current way we have to avoid a recorder B to redo a word already done by a contributor A. I also see the Marathi community is not that fast so far&#160;: 8000 in 2 months for 20+ participants. So It could be better for them to work on the 30,000 most frequent words first, split by letters, reduced by your script. Then if they as us for more rerun the bash command to get the 50,000 most frequent. I would prefer the Marathi community to find some local dev resources to handle this list creation, but maybe we will have to carry it to the finish line. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 22:07, 5 March 2021 (UTC)</dd>
<dd>On a discrete side, I started to map the maintenance functions Lili will need as specific js files to codes. For now, only one is coded. See <a rel="nofollow" class="external text" href="https://github.com/hugolpz/Dragons_Bot#current-script">Dragons bot</a>. The gain here would be to have a maintenance bot dedicated to Lingualibre's tasks. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 22:43, 5 March 2021 (UTC)
<dl><dd>Given the largest letters and calm contributions of the group I assumed at one point they will have to do relays on a same letter. But if we assume consistency, then no need for updates indeed. Thanks for seeing that angles. I will upload their lists. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 11:45, 6 March 2021 (UTC)</dd></dl></dd></dl>
<h2><span class="mw-headline" id="Lists">Lists</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=User_talk:Olaf&amp;action=edit&amp;section=4" title="Edytuj sekcję: Lists">edytuj</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>Olaf bonjour, je pense que tu devrais aimer ce modèle&#160;: &#123;&#123;<a href="/wiki/Template:Wikt-list" title="Template:Wikt-list">Wikt-list</a>&#125;&#125;&#160;;). (<a rel="nofollow" class="external text" href="https://translate.google.com/?sl=auto&amp;tl=en&amp;text=Olaf+bonjour%2C+je+pense+que+tu+devrais+aimer+ce+mod%C3%A8le+%3A+%26%23123%3B%26%23123%3B%5B%5BTemplate%3AWikt-list%7CWikt-list%5D%5D%26%23125%3B%26%23125%3B+%3B%29.&amp;op=translate"><span style="color:#6622DD">translate</span></a>) <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 18:57, 5 March 2021 (UTC)
</p>
<dl><dd>Olaf bonjour, I'am creating this &#123;&#123;<a href="/wiki/Template:Recommended_lists" title="Template:Recommended lists">Recommended lists</a>&#125;&#125; template. The template will be added to 1000 [Category:Speakers in {iso639-3}] to create awareness about best available `paths` to speakers. If we continue to put {#babel:records-mar} on userpages, then these users will be categorized and have a gentle link to [Category:Speakers in {iso639-3}] where they can be reminded of the best paths. I sorted the list by "easiness", first the frequency list of 200, 800 items. Then the wiktionary list of 1000. The lists show up only if they indeed exist. <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 11:35, 6 March 2021 (UTC)</dd></dl>
<h2><span class="mw-headline" id="common.js">common.js</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=User_talk:Olaf&amp;action=edit&amp;section=5" title="Edytuj sekcję: common.js">edytuj</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>Hi Olaf, I saw you have created <a href="/wiki/User:Olaf/common.js" title="User:Olaf/common.js">User:Olaf/common.js</a>. For your information, common.js (and common.css) of users are not enabled for now (see <a href="https://phabricator.wikimedia.org/T273709" class="extiw" title="phab:T273709">T273709</a>) so it should not work for you. <a href="/wiki/User:Pamputt" title="User:Pamputt">Pamputt</a> (<a href="/wiki/User_talk:Pamputt" title="User talk:Pamputt">talk</a>) 12:05, 9 March 2021 (UTC)
</p>
<dl><dd>Hi Olaf. Fyi, I split the ratelimit issue <a rel="nofollow" class="external text" href="https://lingualibre.org/index.php?title=LinguaLibre:Technical_board&amp;diff=479546&amp;oldid=479541">in two tickets</a>. Cheers&#160;! <a href="/wiki/User:Yug" title="User:Yug">Yug</a> (<a href="/wiki/User_talk:Yug" title="User talk:Yug">talk</a>) 23:25, 9 March 2021 (UTC)</dd></dl>

